CREATE DICTIONARY default.person_overrides_dict (`team_id` INT, `old_person_id` UUID, `override_person_id` UUID) PRIMARY KEY team_id, old_person_id SOURCE(CLICKHOUSE(QUERY '\nSELECT\n    team_id,\n    old_person_id,\n    argMax(override_person_id, version)\nFROM\n    `default`.`person_overrides` AS overrides\nGROUP BY\n    team_id,\n    old_person_id\n')) LIFETIME(MIN 5 MAX 10) LAYOUT(COMPLEX_KEY_HASHED(PREALLOCATE 1))